<script>
    var listpesanan = {!! json_encode($listPemesanan) !!};
    $(function(){
        $("#cetak").addClass("active");
    });

    function fnLihatDetail(o, id)
    {
        location.href = "/pemesanan/" + id;
    }

    function fnAjukan(id)
    {
        location.href = "/ajukan_perubahan/" + id;
    }

    function fncetak(id)
    {
            var findpesanan = listpesanan.find(x => x.id === parseInt(id));
            var nama = $("#nama_user").val();
            var nim = $("#nim").val();
            var host = $("#host").val();
            findpesanan.nama = nama;
            findpesanan.nim = nim;
            findpesanan.image = host + "/image/logo2.png"
            findpesanan.tanggal = convertDateFormat(findpesanan.updated_at);

            pdfDownload(findpesanan);
    }
    function convertDateFormat(date)
    {
        var datearray = date.split("-");
        var day = datearray[2].split(" ")[0];
        var final = day + "/" + datearray[1] + "/" + datearray[0];
        return final; 
    }

